import NextButton from "./NextButton";

function FooterComponent({ dispatch, answer, index, numQuestions }) {
  return (
    <footer>
      <NextButton
        dispatch={dispatch}
        answer={answer}
        index={index}
        numQuestions={numQuestions}
      ></NextButton>
    </footer>
  );
}

export default FooterComponent;
